import React, { Component } from 'react';
import { Link } from 'react-router-dom;'
import Menu from './partials/Menu';

class MenuDashboard extends Component {
    render(){
        <nav>
            <ul>
                <li><Link to="/dashboard/sua-escolha">Sua escolha</Link></li>
                <li><Link to="/dashboard/no-estado">No estado</Link></li>
                <li><Link to="/dashboard/na-regiao">Na região</Link></li>
                <li><Link to="/dashboard/geral">Geral</Link></li>
            </ul>
        </nav>
    }
}

class Dashboard extends Component{
    render(){
        return(
            <div>
                <Menu ativo="dashboard" />
                <div className="dashboard">
                    <MenuDashboard />
                </div>
            </div>
        )
    }
}

export default Dashboard;
